import { Link } from 'react-router-dom';
import './AsideMenu.css'


function AsideMenu() {

  return (
    <div className="AsideMenu">
      <ul>
        <li><Link to="/posts"><img src='/icons/home_icon.svg' alt="Главная"/>Главная</Link></li>
        <li><Link><img src='/icons/home_icon.svg' alt="Главная"/>Новости</Link></li>
        <li><Link><img src='/icons/home_icon.svg' alt="Главная"/>Статьи</Link></li>
        <li><Link><img src='/icons/compas_icon.svg' alt="Главная"/>Обзоры</Link></li>
      </ul>
    </div>
  );
}
export default AsideMenu;
